import PhotoProfile from "./Component/Profile/ProfilePhoto";
import FullName from "Component/Profile/FullName";
import Address from "Component/Profile/Address";

function App() {
    return ( <
        div className = "App" >
        <
        ProfilePhoto > < /ProfilePhoto> <
        FullName > < /FullName> <
        Address > < /Address> <
        /div>
    );
}

export default App;
